import "./App.css";
import React, { useEffect, usestate} from "react";
import Header from "./components/header";
import Introduction from "./components/Introduction";
function App() {
  const [message, setMessage] = useState();

  useEffect(() => {
    fetch("/") // Fetch from the /
      .then((response) => response.json()) // Process the extract to response with JSON data 
      .then((data) => setMessage({no : data.no, description : data.description})); // Take the extracted data and set the message
  });

  return (
    <>
      <Header />
      <Introduction no={message.no} description={message.description}/>
    </>
  );
}

export default App;
